import React, { useState } from 'react'
import { utils,read } from "xlsx"

const ImportExcel = () => {
  const [excelData, setExcelData] = useState([])
  const file_type=['application/vnd.openxmlformats-officedocument']
  const handleChange = (e) => {
    const selected_file = e.target.files[0];
    if (selected_file) {
      console.log(selected_file.type)
    }
  }
  return (
    <div className='justify-center item-center flex flex-col'>
      <div>
        <input type='file'>
          onChange={handleChange}
        </input>
      </div>
      <div>
        <table>
          <thead>
            <tr>
              <th>Sl. No. </th>
              <th>Journal name </th>
              <th>2022 JIF </th>
            </tr>
          </thead>
          <tbody>
            {
              excelData ? (<></>)
                : (
                  <h2>No available Data is present</h2>
                )
            }
          </tbody>
        </table>
      </div>
  </div>)
}

export default ImportExcel
